import { StarsBackground } from './stars-background';

export const BackgroundGradient = ({ children }) => {
  return (
    <div className="relative w-full h-full overflow-hidden">
      <StarsBackground className="z-0" />
      <ShootingStars className="z-10" />
      {children}
    </div>
  );
};
